import React from 'react';

const DoctorForApproval = ({ doctor }) => {
  return (
    <div className="doctor-card">
      <img src={doctor.profilePicture} alt={doctor.name} />
      <div className="doctor-info">
        <h2>{doctor.name}</h2>
        <p>Specialization: {doctor.specialization}</p>
        <p>Credentials: {doctor.credentials}</p>
        {/* pwede siguro pa idagdag dito yung clinic and other proof of some sort */}
        <button style={{padding: 5, borderRadius: 0, width:"150px"}}>Approve</button>
        <br/>
        <button style={{padding: 5, borderRadius: 0, width:"150px", backgroundColor:"grey"}}>Reject</button>
      </div>
    </div>
  );
};

export default DoctorForApproval;
